  const App = () => {
    return (
      <Router>
        <Routes>
          {/* Main Page */}
          <Route path="/" element={<MainPage />} />

          {/* Vehicle Owner Pages */}
          <Route path="/vehicle-owner" element={<V_HomePage />} />
          <Route path="/vehicle-owner/signup" element={<V_SignupPage />} />
          <Route path="/vehicle-owner/login" element={<V_LoginPage />} />
          <Route path="/vehicle-owner/dashboard" element={<V_DashboardPage />} />

          {/* Fuel Station Owner Pages */}
          <Route path="/fuel-station" element={<F-HomePage />} />
          <Route path="/fuel-station/signup" element={<F-SignupPage />} />
          <Route path="/fuel-station/login" element={<F-LoginPage />} />
          <Route path="/fuel-station/dashboard" element={<F-DashboardPage />} />
        </Routes>
      </Router>
    );

  // return (
  //   <Router>
